    false,nt"url": null,nt"notes": "The Expeditions Information System (EIS)
    contains information recorded by the NOAA Office of Ocean Exploration's data manager
    during the 2002 "Islands in the Stream - Exploration of Outer Shelf and Slope Habitats
    off the Coast of North Carolina" expedition, August 5 through 15, 2002. Information
    contained in the EIS includes submersible, remotely operated vehicle, autonomous
    underwater vehicle, and SCUBA operational information and a summary of scientific
    observations during each dive; ship activity information (positions, transits, and
    visitor shuttles); sample information; water column and bottom conditions; weather
    observations; sea state observations; education and outreach activity information;
    media event information; scientific instrumentation information; transect information;
    dive site profiles; and a record of all data collected by principal investigators.
    The data presented here are the tables from the original EIS which is a FileMaker
    Pro database.",nt"license_title": "License Not Specified",nt"extras":
